import React from 'react';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './index.css';


function App() {
  return (
    <div className="App">
      <div class="jumbotron">
        <h1>Hire An Artist</h1>
        <p class="lead">One stop solution for content creators </p>
      </div>

    <div className="row">
      <div className="col-sm">
      <button type="button" class="btn btn-primary btn-lg">Primary</button>
      </div>
      </div>  
    </div>

  );
}

export default App;
